import Button from '@mui/material/Button';

const AddButton = () => {


    return (
        <div>
            <Button 
                href="/pets/new"
                variant="contained"

                style = {{
                    backgroundColor: 'rgb(248, 181, 161)',
                    "&:hover": {
                        //you want this to be the same as the backgroundColor above
                        backgroundColor: "#FFF"
                    }
                }}
                >Add Pet</Button>
        </div>

    );
};


export default AddButton;
